ALTER TABLE dbo.ServiceTypeCodePayerNumber
ADD  CONSTRAINT [DF_ServiceTypeCodePayerNumber_CreatedDate]  DEFAULT (getdate()) FOR [CreatedDate]
GO

ALTER TABLE dbo.ServiceTypeCodePayerNumber
ADD  CONSTRAINT [DF_ServiceTypeCodePayerNumber_ModifiedDate]  DEFAULT (getdate()) FOR [ModifiedDate]
GO



select distinct ClearinghouseID, PayerNumber 
into #MedicarePayerNumbers
from ClearinghousePayersList 
where Name like 'medicare%' or PayerNumber='00320'
and Active=1

SELECT ServiceTypeCode, MPN.ClearinghouseID, MPN.PayerNumber
FROM ServiceTypeCodePayerNumber ST
CROSS JOIN #MedicarePayerNumbers MPN
WHERE ST.PayerNumber = 'MEDICARE'

DROP TABLE #MedicarePayerNumbers

